import React, { Component } from 'react';
//import MensajeEstatico from './MensajeEstatico';
import Pelicula from './Pelicula';

class Peliculas extends Component {

    state = {
        peliculas: [
            {
                titulo: 'Batman vs Superman', image: 'data:image/jpeg;base64,'
            },
            {
                titulo: 'Spiderman', image: 'data:image/jpeg;base64,'
            },
            {
                titulo: 'IronMan', image: 'https://i.pinimg.com/originals/6c/7a/63/6c7a63fbd616e24c42a3b9b427389d92.jpg'
            },
            {
                titulo: 'Wonder Woman', image: 'data:image/jpeg;base64,'
            },
            {
                titulo: 'Aquaman', image: 'data:image/jpeg;base64,'
            }

        ],
        nombre: 'Pedro Moreno'
    }

    cambiarTitulo = ()=> {

        var {peliculas}= this.state;
        //var random = Math.floor(Math.random() * 5);
        peliculas[0].titulo = 'Batman';

        this.setState({
            peliculas: peliculas
        })
    }

    favorita = ()=>{
        console.log('Marcada');
        console.log();
    }

    render() {
        return (
            <div id="content" className="peliculas">
                <h2 className="subheader">Peliculas</h2>
                <p>Seleccion de peliculas de {this.state.nombre}</p>
                <p><button onClick={this.cambiarTitulo}>Cambiar titulo de Batman</button></p>
                <p><strong>La Pelicula favorita es: <span>X</span></strong></p>

                {/*Crear Componente de peliculas*/}
                <div id="articles" className="peliculas">
                    {
                        this.state.peliculas.map((pelicula, i) => {
                            return (
                                <Pelicula key={i} pelicula={pelicula} marcarFavorita={this.favorita}/>
                            );
                        })
                    }
                </div>


            </div>

        );
    }
}

export default Peliculas;
